import React, { useState } from "react";

const LoginScreen = () => {

    const [developerState, setDeveloperState] = useState({
        username: "",
        password: ""
      });

    const handleInputChange = evt => {
        evt.preventDefault();
    }
    return (
        <form>
            <div>
                <p>UserName</p>
                <input onChange={(evt)=> evt.target.value}></input>
            </div>
            <div>
                <p>Password</p>
                <input onChange={(evt)=> evt.target.value}></input>
            </div>
            <div>
                <button onClick={(evt) => setDeveloperState({ username: evt.target.value, password: evt.target.value})}>Login</button>
            </div>
            
        </form>
    )
}

export default LoginScreen;
